DROP TABLE IF EXISTS `empleado`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `empleado` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `apellidos` varchar(255) DEFAULT NULL,
  `cargo` varchar(255) DEFAULT NULL,
  `ciudad_expedicion` varchar(255) DEFAULT NULL,
  `correo` varchar(255) DEFAULT NULL,
  `direccion` varchar(255) DEFAULT NULL,
  `edad` int NOT NULL,
  `estado_civil` enum('CASADO','SEPARADO','SOLTERO','UNION_LIBRE','VIUDO') DEFAULT NULL,
  `fecha_nacimiento` date DEFAULT NULL,
  `genero` enum('FEMENINO','MASCULINO') DEFAULT NULL,
  `libreta_militar` enum('PRIMERA','SEGUNDA','NO_TIENE') DEFAULT NULL,
  `lugar_nacimiento` varchar(255) DEFAULT NULL,
  `nombres` varchar(255) DEFAULT NULL,
  `numero_documento` varchar(255) DEFAULT NULL,
  `telefono` varchar(255) DEFAULT NULL,
  `tipo_documento` enum('CC','CE','TI','PPT') DEFAULT NULL,
  `tipo_empleado` enum('ADMINISTRATIVO','OPERATIVO') DEFAULT NULL,
  `tipo_poblacion` enum('AFRODESCENDIENTE','RAIZAL','INDIGENA','GITANO','PALENQUERO','NO_APLICA') DEFAULT NULL,
  `foto` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `UNIQUE_correo` (`correo`),
  UNIQUE KEY `UNIQUE_numero_documento` (`numero_documento`)
) ENGINE=InnoDB AUTO_INCREMENT=186 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
